import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Competition() {
  const [selectedGroups, setSelectedGroups] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/api/selectedGroups')
      .then((response) => {
        const selectedGroupsData = response.data;
        setSelectedGroups(selectedGroupsData); // Store the data in state
        console.log('Selected Groups Data:', selectedGroupsData); // Log the data to the console
      })
      .catch((error) => {
        console.error('Error fetching selected groups:', error);
      });
  }, []);

  return (
    <div>
      <h1>Competition</h1>
    </div>
  );
}

export default Competition;
